var b="url",c="미래탐구_캠퍼스_페이지.html",d="generationDate",e=new Date(1708658811200.26),f="defaultAdaptiveView",g="name",h="Large Display",i="size",j="width",k=1440,l="height",m=0,n="adaptiveViews",o="sketchKeys",p="",q="s0",r="variables",s="OnLoadVariable",t="page",u="packageId",v="712017c3368b478880ab917eff459178",w="type",x="Axure:Page",y="미래탐구 캠퍼스 페이지",z="notes",A="annotations",B="fn",C="1",D="ownerId",E="d41c147f736e40c1b211127b596a7bb4",F="label",G="숨김처리",H="Note",I="<p><span style=\"font-family:'Noto Sans KR Bold', 'Noto Sans KR Regular', 'Noto Sans KR', sans-serif;font-weight:700;\">1) 뽀모도로 타이머</span></p><p><span style=\"font-family:'Noto Sans KR', sans-serif;\">1-1) 학습관리 페이지 접속 시, 우측 상단에 타어머 영역 활성화</span></p><p><span style=\"font-family:'Noto Sans KR', sans-serif;color:#D9001B;\">* 해당 페이지 접속 시에, 강제로 타이머 작동할 지는 확인 필요</span></p><p><span style=\"font-family:'Noto Sans KR', sans-serif;\">1-2) 리사이즈 버튼 클릭 시, 뽀모도로 타이머 레이어팝업 활성화</span></p><p><span style=\"font-family:'Noto Sans KR', sans-serif;\">1-3) 타이머 실행 시, 브라우저 쿠키 내에 지속적으로 유지시켜 다시 접속하여도 타이머가 멈추지 않도록 적용</span></p><p><span style=\"font-family:'Noto Sans KR', sans-serif;\">1-4) 특정 height 시, 뽀모도로 타이머 하단 중간에 고정값 적용</span></p><p><span style=\"font-family:'Noto Sans KR', sans-serif;\"><br></span></p><p><span style=\"font-family:'Noto Sans KR', sans-serif;\"><br></span><span style=\"font-family:'Noto Sans KR Bold', 'Noto Sans KR Regular', 'Noto Sans KR', sans-serif;font-weight:700;\">* 뽀모도로 학습법이란</span><span style=\"font-family:'Noto Sans KR', sans-serif;\"><br>뽀모도로 학습법은 집중력을 높이고 번아웃을 방지하며, 부담스러운 일을 작게 쪼개어 진행할 수 있도록 도와줍니다.</span></p><p><span style=\"font-family:'Noto Sans KR', sans-serif;\">대개, 25분 동안 집중해서 일을 한 다음 5분간 휴식하는 방식입니다. 25분 집중과 5분 휴식의 사이클을 1회 완료하는 것을 1 뽀모도로라고 합니다.</span></p>",J="2",K="ff6b06da8359491a800a4b71c12927c5",L="(Rectangle)",M="<p><span style=\"font-family:'Noto Sans KR Bold', 'Noto Sans KR Regular', 'Noto Sans KR', sans-serif;font-weight:700;\">2) 뽀모도로 타이머 레이어 팝업</span></p><p><span style=\"font-family:'Noto Sans KR', sans-serif;\">- (좌측) 타이머 기능</span></p><p><span style=\"font-family:'Noto Sans KR', sans-serif;\">- (우측) 타이머 부가기능</span></p>",N="3",O="62684cc309f04e7ba9907a021c458f40",P="(Dynamic Panel)",Q="<p><span style=\"font-family:'Noto Sans KR Bold', 'Noto Sans KR Regular', 'Noto Sans KR', sans-serif;font-weight:700;\">3) 타이머가 작동되지 않을 경우</span></p><p><span style=\"font-family:'Noto Sans KR', sans-serif;font-weight:400;\">- 토스트메시지 안내</span></p>",R="style",S="baseStyle",T="627587b6038d43cca051c114ac41ad32",U="pageAlignment",V="center",W="fill",X="fillType",Y="solid",Z="color",ba=0xFFFFFFFF,bb="image",bc="imageAlignment",bd="near",be="imageRepeat",bf="auto",bg="favicon",bh="sketchFactor",bi="0",bj="colorStyle",bk="appliedColor",bl="fontName",bm="Applied Font",bn="borderWidth",bo="borderVisibility",bp="borderFill",bq=0xFF797979,br="cornerRadius",bs="cornerVisibility",bt="outerShadow",bu="on",bv=false,bw="offsetX",bx=5,by="offsetY",bz="blurRadius",bA="spread",bB="r",bC=0,bD="g",bE="b",bF="a",bG=0.349019607843137,bH="adaptiveStyles",bI="interactionMap",bJ="onScroll",bK="eventType",bL="OnWindowScroll",bM="description",bN="Window Scrolled",bO="cases",bP="Case 1",bQ="conditionString",bR="if &quot;[[Window.scrollY]]&quot; is greater than or equals &quot;5&quot;",bS="isNewIfGroup",bT="caseColorHex",bU="AB68FF",bV="condition",bW="exprType",bX="binaryOp",bY="op",bZ=">=",ca="leftExpr",cb="stringLiteral",cc="value",cd="[[Window.scrollY]]",ce="localVariables",cf="stos",cg="computedType",ch="int",ci="sto",cj="propCall",ck="thisSTO",cl="var",cm="window",cn="prop",co="scrolly",cp="rightExpr",cq="5",cr="actions",cs="action",ct="fadeWidget",cu="Show (Dynamic Panel)fade 500ms,<br>Hide 숨김처리fade 500ms",cv="displayName",cw="Show/Hide",cx="actionInfoDescriptions",cy="Hide 숨김처리",cz="fade 500ms",cA="Show (Dynamic Panel)fade 500ms,\nHide 숨김처리fade 500ms",cB="Show (Dynamic Panel)",cC="objectsToFades",cD="objectPath",cE="d41c147f736e40c1b211127b596a7bb4",cF="fadeInfo",cG="fadeType",cH="hide",c